import { useParams } from "react-router-dom";

function Food({foods}){
    const params = useParams();
    console.log(params);
    const food = foods ? foods.filter(food => food.id === params.id) : null;

    return (
        <div>
            <h2>{food.name}{food.emoji}</h2>

        </div>
    )
}

export default Food
